INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (1259, CONCAT('Minami-ke Okaeri'), CONCAT('A year has passed since Okawari and the three sisters have grown up. Their likings and moods are almost the same. Haruka, the older sister, is a love-giving mother to the younger sisters and a discipline follower. Kana, the middle one, leaves everything to the last possible moment and always gives trouble to the trio. Chiaki, the little one, is the calculating and manipulating one she likes to be admired and loved by Haruka and always gives trouble to the less blessed Kana. Despite being an unbalanced family, they love each other with all their heart. The family', CHAR(39), 's daily life is as funny as ever trouble and love are always present. Now it', CHAR(39), 's time to see if they', CHAR(39), 'll survive this age change since Haruka is now a young adult she has even more responsibilities, having to watch over the young while integrating into the adult life.<br>
